import React from "react";
import { Container, Button } from "@material-ui/core";
import Welcome from "../components/welcome";

class MainPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      page: "welcome",
    };
  }
  gerPage = () => {
    switch (this.state.page) {
      case "welcome":
        return <Welcome />;
      default:
        return null;
    }
  };

  render() {
    return (
      <Container>
        <div
          style={{
            textAlign: "center",
            position: "relative",
            marginTop: "20%",
          }}
        >
          <h1>Here is the main page of Facial testing</h1>
        </div>
      </Container>
    );
  }
}

export default MainPage;
